import React from 'react';
import movies from '../movies'
import Movie from './Movie'
function Products(){
     return (
        <>
        
      <div className="countries-container">
      <h3>Recommended Movies</h3>
      
      {movies.map((data)=> 
         
         <Movie 
           id={data.id}
           year={data.year}
           title={data.title}
           poster={data.poster}
           genre={data.genre}
         />
        )}</div>
        
        </>
     )
}

export default Products;
